import React from "react";
import Navbar from "../navbar/Navbar";
import NavbarJury from "../navbar/NavbarJury";

function IsUser(props){
    console.log(props.ROLES)
    if ((props.ROLES.Admin)  || (props.ROLES.Jury )) {
      return (
        <>
            { props.ROLES.Admin ? (
              <NavbarJury/>
            ) : (
              <Navbar/>
            )
            }
          </>
      )
    } else {
      return null
    } 
}

export default IsUser;
